if (source == null) {
	secureRandomInstance.nextBytes(new byte[1]);
}
else {
	InputStream inputStream = source.getInputStream();
	byte[] seed = FileCopyUtils.copyToByteArray(inputStream);
	secureRandomInstance.setSeed(seed);
