if (source != null) {
	InputStream inputStream = null;
	try {
		inputStream = source.getInputStream();
		byte[] seed = FileCopyUtils.copyToByteArray(inputStream);
		secureRandomInstance.setSeed(seed);
	}
	finally {
		if (inputStream != null) {
			try {
				inputStream.close();
			}
			catch (IOException ex) {
				// ignore
			}
		}
	}
}

